import React, { Component } from 'react';
import { Nav } from 'react-bootstrap';
import '../Styles/Cities.css';
import Navigation from '../Components/Navigation';
import Footer from '../Components/Footer';
import Jumbotron from 'react-bootstrap/Jumbotron';
import Card from 'react-bootstrap/Card';
import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';
import Austin from '../static_resources/austin_tx.png';
import SanFrancisco from '../static_resources/sanfrancisco_ca.png';
import Seattle from '../static_resources/seattle_wa.png';

class Cities extends Component {
  render() {
    return (
      <div>
        <Navigation />
        <Jumbotron className="cities-jumbotron"></Jumbotron>

        <p>
          City matters a lot when deciding a University to attend. <br />
          Whether you're a West Coast or East Coast person, prefer a big or
          small city, or looking for a city that has great access to nature,
          there's a city for you!
        </p>

        <Container>
          <Row>
            <Col md={4}>
              <Card className="cities-card">
                <Nav.Link href="/cities/sanfrancisco_ca">
                  <Card.Img src={SanFrancisco} variant="top" height="200" />
                  <Card.Body>
                    <Card.Title>San Francisco, CA</Card.Title>
                    <Card.Text>Student Score: 95.50</Card.Text>
                  </Card.Body>
                </Nav.Link>
              </Card>
            </Col>
            <Col md={4}>
              <Card className="cities-card">
                <Nav.Link href="/cities/seattle_wa">
                  <Card.Img src={Seattle} variant="top" height="200" />
                  <Card.Body>
                    <Card.Title>Seattle, WA</Card.Title>
                    <Card.Text>Student Score: 93.75</Card.Text>
                  </Card.Body>
                </Nav.Link>
              </Card>
            </Col>
            <Col md={4}>
              <Card className="cities-card">
                <Nav.Link href="/cities/austin_tx">
                  <Card.Img src={Austin} variant="top" height="200" />
                  <Card.Body>
                    <Card.Title>Austin, TX</Card.Title>
                    <Card.Text>Student Score: 90.50</Card.Text>
                  </Card.Body>
                </Nav.Link>
              </Card>
            </Col>
          </Row>
        </Container>
        <p></p>
        <Footer />
      </div>
    );
  }
}

export default Cities;
